import React, { Component } from "react";
import "./footer.css";

export default class Footer extends Component {
  render() {
    return (
      <div className="rod">
        <footer>
          <small>
            Copyright &copy; Boteco Virtual - Todos os direitos reservados.{" "}
          </small>
        </footer>
      </div>
    );
  }
}
